import React from 'react';
import styled from 'styled-components';

const RibbonHolder = styled.div`
  width: 100px;
  height: 100px;
  background: red;
  position: relative;
  top: -5px;
  right: -5px;
  overflow: hidden;
`;

const RibbonBody = styled.span`
  width: 200px;
  height: 40px;
  padding: 5px 0;
  color: white;
  background: blue;
  display: block;
  position: relative;
  top: 15px;
  left: -40px;
  transform: rotate(45deg);
  text-align: center;
`;

const Ribbon = () => {
  return (
    <RibbonHolder>
      <RibbonBody>sdfa</RibbonBody>
    </RibbonHolder>
  );
};

export default Ribbon;
